import React, { useState } from "react";
import Header from "./Header";
import axios from 'axios';


export default function Upload() {
    const [patientName , setPatientName] = useState('');
    const [patientAge , setPatientAge]=useState('');
    const [patientWeight , setPatientWeight]=useState('');
    const [patientHeight , setPatientHeight]=useState('');
    const [patientPhone , setPatientPhone]=useState('');
    const [patientMail , setPatientMail]=useState('');
    const [patientDescription , setPatientDescription]=useState('');

    const handleSubmit = async (e)=>{
    e.preventDefault();
    const formData ={
        patientName,
        patientAge,
        patientWeight,
        patientHeight,
        patientPhone,
        patientMail,
        patientDescription,
    }

}    
return (

        <div>
            <Header/>
            <div className="contparent">
            <div className="container">
                <h2>Patient Upload Form</h2>
                <form action="/submit" method="post" enctype="multipart/form-data" className="uploadform" onSubmit={handleSubmit}>
                    <label htmlFor="name">Name:</label>
                    <input 
                    type="text" 
                    id="name" 
                    value={patientName}
                    onChange={(e) => setPatientName(e.target.value)}
                    name="name" required />

                    <label htmlFor="age">Age:</label>
                    <input 
                    type="number" 
                    id="age" 
                    value={patientAge}
                    onChange={(e) => setPatientAge(e.target.value)}
                    name="age" required />

                    <label htmlFor="height">Height (cm):</label>
                    <input 
                    type="number" 
                    id="height" 
                    value={patientHeight}
                    onChange={(e) => setPatientHeight(e.target.value)}
                    name="height" required />

                    <label htmlFor="weight">Weight (kg):</label>
                    <input 
                    type="number" 
                    id="weight" 
                    value={patientWeight}
                    onChange={(e) => setPatientWeight(e.target.value)}
                    name="weight" required />

                    <label htmlFor="phone">Phone Number:</label>
                    <input 
                    type="tel" 
                    id="phone"
                    value={patientPhone} 
                    onChange={(e) => setPatientPhone(e.target.value)}
                    name="phone" required />

                    <label htmlFor="email">Gmail ID:</label>
                    <input 
                    type="email" 
                    id="email" 
                    value={patientMail}
                    onChange={(e) => setPatientMail(e.target.value)}
                    name="email" required />

                    <label htmlFor="gender">Gender:</label>
                    <select id="gender" name="gender" required>
                        <option value="">Select</option>
                        <option value="male">Male</option>
                        <option value="female">Female</option>
                        <option value="other">Other</option>
                    </select>

                    <label htmlFor="description">Description of Past Health Issues:</label>
                    <textarea 
                    id="description" 
                    name="description" 
                    value={patientDescription}
                    onChange={(e) => setPatientDescription(e.target.value)}
                    rows="4" required></textarea>

                    <label htmlFor="report">Upload PDF of Reports:</label>
                    <input type="file" id="report" name="report" accept="application/pdf" required />

                    <div className="buttons">
                        <button type="submit">Submit</button>
                        <button type="reset">Cancel</button>
                    </div>
                </form>
            </div>
            </div>
        </div>
    );
}
